import React from "react";

function Pagination(props) {
  let current_page = props.current_page;

  return (
    <ul className="pagination">
      <li
        className="page-item page-link"
        onClick={() => {
          props.setCurrentPage(current_page - 1);
        }}
      >
        {"<"} Prev
      </li>
      <li
        className="page-item page-link"
        onClick={() => {
          props.setCurrentPage(current_page + 1);
        }}
      >
        Next {">"}
      </li>
    </ul>
  );
}

export default Pagination;
